import React from "react";

function Navbar() {
  return (
    <nav className="navBar">
      <img
        className="navBar__logo"
        src='https://www.google.com/imgres?imgurl=https%3A%2F%2Fpngimg.com%2Fuploads%2Famazon%2Famazon_PNG13.png&imgrefurl=https%3A%2F%2Fpngimg.com%2Fimages%2Flogos%2Famazon&tbnid=FXKo05aSEEM6cM&vet=12ahUKEwjRzJezhcT4AhXBKbcAHQdJCBUQMygBegUIARDQAQ..i&docid=El86t1bc0Y6uuM&w=2048&h=1536&q=amazon%20logo%20png&ved=2ahUKEwjRzJezhcT4AhXBKbcAHQdJCBUQMygBegUIARDQAQ'
        alt="error"
      />
    </nav>
  );
}

export default Navbar;
